// Dashboard.js
import React from 'react';
import { Layout, Menu, Avatar } from 'antd';
import { UserOutlined, LogoutOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';
import '../../styles/Dashboard.css';

const { Header, Content, Sider } = Layout;

const Dashboard = () => {
  return (
    <Layout style={{ minHeight: '100vh' }}>
      <Sider width={200} className="site-layout-background">
        <div className="logo">logo</div>
        <Menu mode="vertical" defaultSelectedKeys={['1']}>
          <Menu.Item key="1">
            <Link to="/">Dashboard</Link>
          </Menu.Item>
          <Menu.Item key="2">
            <Link to="/my-meal">My meal</Link>
          </Menu.Item>
          <Menu.Item key="3">My report</Menu.Item>
          <Menu.Item key="4" icon={<LogoutOutlined />}>Logout</Menu.Item>
        </Menu>
      </Sider>

      <Layout>
        <Header className="header">
          <div className="user-info">
            <Avatar icon={<UserOutlined />} /> Moni Roy
          </div>
        </Header>

        <Content style={{ margin: '16px 24px' }}>
          <div className="dashboard-section">
            <h1>Welcome to the Dashboard</h1>
            {/* Add any dashboard specific content here */}
          </div>
        </Content>
      </Layout>
    </Layout>
  );
};

export default Dashboard;
